let year;
let user_id;
let amka;
let city;
let status;
let firstname;
let lastname;
let birthdate;

function createTableFromJSON(data) {
    var html = "<table><tr><th>Category</th><th>Value</th></tr>";
    for (const x in data) {
        var category = x;

        var value = data[x];
        if (category === "birthdate")
            year = value.substring(0, 4);

        if (category === "user_id")
            user_id = value;

        if (category === "amka")
            amka = value;

        if (category === "birthdate")
            birthdate = value;

        if (category === "city")
            city = value;

        if (category === "status")
            status = value;

        if (category === "firstname")
            firstname = value;

        if (category === "lastname")
            lastname = value;

        html += "<tr><td><b>" + category + "</td><td></b>" + value + "</td></tr>";
    }
    html += "</table>";
    return html;
}

/* show user's data */
function show_data() {
    var xhr = new XMLHttpRequest();
    xhr.onload = function () {
        if (xhr.readyState === 4 && xhr.status === 200) {
            $("#data_alert").html(createTableFromJSON(JSON.parse(xhr.responseText)));
        } else if (xhr.status !== 200) {
            $("#data_alert").html("Data could not be retrieved");
        }
    };
    /* called POST from servlet Logout because it was empty 
     insted of creating another servlet */
    xhr.open('POST', 'Logout');
    xhr.send();
}

/* JSON table for doctors */
function createTableFromJSON_hospital(data, i) {
    var html = "<h4>Doctor " + i + "</h4><table><tr><th>Category</th><th>Information</th></tr>";
    for (const x in data) {
        var category = x;

        var value = data[x];
        html += "<tr><td>" + category + "</td><td>" + value + "</td></tr>";
    }
    html += "</table><br>";
    return html;

}

/* show hospitals */
function hospitalsGET() {
    var x = document.getElementById("hos_alert");
    if (x.style.display === "none") {
        x.style.display = "block";
        document.getElementById("hos_alert").innerHTML = "";
    } else {
        x.style.display = "none";
        document.getElementById("hos_alert").innerHTML = "";
    }
    var xhr = new XMLHttpRequest();
    xhr.onload = function () {
        if (xhr.readyState === 4 && xhr.status === 200 && xhr.responseText !== "") {
            var html = "<table><tr><th>Hospital Id</th><th>Name</th><th>Address</th><th>Address No.</th><th>City</th></tr>";
            document.getElementById("hos_alert").innerHTML = html + xhr.responseText + "</table>";
        } else {
            $("#hos_alert").html("No available health centers in this city.");
        }
    };
    xhr.open('GET', 'GetHospital?' + String(city));
    xhr.setRequestHeader('Content-type', 'application/x-www-form-urlencoded');
    xhr.send();
}

