/* cancel appointment */
function cancel_appointment() {
    var xhr = new XMLHttpRequest();
    xhr.onload = function () {
        if (xhr.readyState === 4 && xhr.status === 200) {
            document.getElementById('randevouz_alert4').innerHTML = "Appointment cancelled.";
            show_upcoming_appointments();
        } else if (xhr.status === 403) {
            document.getElementById('randevouz_alert4').innerHTML = "No appointments with this id. Note that you can't cancel a completed appointment.";
        } else if (xhr.status !== 200) {
            document.getElementById('randevouz_alert4').innerHTML = "Appointment Id is not correct.";
        }
    };
    var randevouz_id = document.getElementById("randevouz_id2").value;

    if (randevouz_id !== "") {
        /* called servlet GetHospital because it had an empty POST method */
        var data = $('#Form_cancel').serialize() + "&user_id=" + user_id;
        xhr.open('POST', 'GetHospital?' + data);
        xhr.setRequestHeader("Content-type", "application/json");
        xhr.send();
    } else {
        document.getElementById('randevouz_alert4').innerHTML = "Appointment Id is empty.";
    }
}

/* vaccination certificate */
function vaccination_conf() {
    var xhr = new XMLHttpRequest();
    xhr.onload = function () {
        if (JSON.parse(xhr.responseText).length !== 0) {
            if (xhr.readyState === 4 && xhr.status === 200) {
                const obj = JSON.parse(xhr.responseText);
                var len = obj.length / 4;
                var i = 0;
                var j = 0;

                document.getElementById('pdf_alert').innerHTML = "PDF created. Please check your downloads.";

                var obj2 = new jsPDF('a4');

                var font = "";

                obj2.addFileToVFS("Arialbd.ttf", font);
                obj2.addFont("Arialbd.ttf", "Arialbd", "bold");
                obj2.setFont('Arialbd', 'bold');

                obj2.text('SARS-Cov-2 Vaccination Record Certificate', 70, 25);
                obj2.text('Βεβαίωση Εμβολιασμού SARS-Cov-2', 70, 30);

                obj2.autoTable({
                    startX: 30,
                    startY: 40,
                    head: [
                        ['Name', 'Surname', 'SSN'],
                        ['Όνομα', 'Επώνυμο', 'AMKA']
                    ],
                    body: [
                        [firstname, lastname, amka]
                    ],
                    headStyles: {
                        font: 'Arialbd'
                    }
                });

                while (i < len) {
                    obj2.autoTable({
                        startY: obj2.lastAutoTable.finalY + 20,
                        startX: 30,
                        head: [
                            ['Dose', 'Hospital', 'Date & Time', 'Vaccine'],
                            ['Δόση', 'Νοσοκομείο', 'Ημερομηνία & Ώρα', 'Εμβόλιο']
                        ],
                        body: [
                            [obj[j], obj[j + 1], obj[j + 2], obj[j + 3]]
                        ],
                        headStyles: {
                            font: 'Arialbd'
                        }
                    });
                    j += 4;
                    i++;
                }
                obj2.setFontSize(8);
                obj2.text('The certificate is issued in accordance with the data entered and kept in the National COVID-19 Vaccination Registry.', 15, obj2.lastAutoTable.finalY + 20);
                obj2.text('Η βεβαίωση εκδίδεται σύμφωνα με τα στοιχεία που έχουν καταχωριστεί και τηρούνται στο Εθνικό Μητρώο Εμβολιασμών', 15, obj2.lastAutoTable.finalY + 28);
                obj2.text('κατά του κορωνοϊού COVID-19.', 15, obj2.lastAutoTable.finalY + 32);

                var myImage = new Image();
                var myImage2 = new Image();
                myImage2.src = 'media/qrcode.png';
                myImage.src = 'media/emblem.png';
                myImage.onload = function () {
                    obj2.addImage(myImage, 'png', 15, 5, 50, 30);
                    obj2.addImage(myImage2, 'png', 15, obj2.lastAutoTable.finalY + 50, 50, 50);
                    obj2.save('VaccinationConfirmation.pdf');
                };

                obj2.setFontSize(12);
                obj2.text('Document Id/ Κωδικός εγγράφου: ' + makeid(22), 15, obj2.lastAutoTable.finalY + 40);
            }
        } else {
            document.getElementById('pdf_alert').innerHTML = "At least one appointment should be completed.";

        }
    };

    xhr.open('GET', 'Message?' + String(user_id));
    xhr.send();
}
