/* generate document id */
function makeid(length) {
    var result = '';
    var characters = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789';
    var charactersLength = characters.length;
    for (var i = 0; i < length; i++) {
        result += characters.charAt(Math.floor(Math.random() *
                charactersLength));
    }
    return result;
}

Date.prototype.addDays = function (days) {
    var date = new Date(this.valueOf());
    date.setDate(date.getDate() + days);
    return date;
};

/* add 20 days to date picker for the next appointment */
function check_prev_appointments(user_id) {
    
    var xhr = new XMLHttpRequest();
    xhr.onload = function () {
        if (JSON.parse(xhr.responseText).length !== 0) {
            if (xhr.readyState === 4 && xhr.status === 200) {

                const obj = JSON.parse(xhr.responseText);
                var len = obj.length;


                var date = new Date(obj[len - 2]);

                var year = obj[len - 2].substring(0, 4);

                var add_days = date.addDays(20);
                var day = add_days.getUTCDate();
                var month = add_days.getUTCMonth() + 1;

                if (day < 10) {
                    day = '0' + day;
                }
                if (month < 10) {
                    month = '0' + month;
                }

                var new_date = year + '-' + month + '-' + day;

                document.getElementById("date_picker").defaultValue = new_date + "";
                $('#date_picker').attr('min', new_date);
            }
        } else {
            
            var date = new Date();
            var tomorrow = new Date();
            var dd = tomorrow.setDate(tomorrow.getDate() + 1);
            var dd = tomorrow.getDate();

            var mm = date.getMonth() + 1;
            var yyyy = date.getFullYear();

            if (dd < 10) {
                dd = '0' + dd;
            }
            if (mm < 10) {
                mm = '0' + mm;
            }
            date = yyyy + '-' + mm + '-' + dd;
            document.getElementById("date_picker").defaultValue = date + "";
            $('#date_picker').attr('min', date);
        }
    };

    xhr.open('GET', 'GetAppointments?' + String(user_id));
    xhr.send();
}

